import React from "react";
import { useSelector } from "react-redux";
import { Route, Routes } from "react-router-dom";
import Admin from "./Header/Admin";
import Header from "./Header/Header";
import SigninForm from "./Header/SigninForms/SigninForm";
import SignupForm from "./Header/SigninForms/SignupForm";
import User from "./Header/User";

import Main from "./Main/Main";

const App = () => {
  const token = useSelector((state) => state.application.token);
  const admin = useSelector((state) => state.application.role);
  return (
    <div className="App">
      <Header />
      <Main />
      <Routes>
        {!token ? (
          <div>
            <Route path="/login" element={<SigninForm />} />
            <Route path="/logup" element={<SignupForm />} />
          </div>
        ) : admin === "admin" ? (
          <Route path="/admin" element={<Admin />} />
        ) : (
          <Route path="/user" element={<User />} />
        )}
      </Routes>
    </div>
  );
};

export default App;
